import { StyleSheet } from "react-native";

export default StyleSheet.create({
  container: {
    backgroundColor: "#303F9F",
    width: "100%",
    height: "100%",
  },
  inputContainer: {
    height: 400,
    marginTop: "35%",
    marginLeft: 19,
    marginRight: 31,
    marginBottom: "20%",
    backgroundColor: "#FFFFFF",
    borderRadius: 10,
    shadowColor: "#000000",
    shadowOpacity: 0.8,
    shadowRadius: 2,
    shadowOffset: {
      height: 1,
      width: 1,
    },
  },
  textInput: {
    borderRadius: 10,
    height: "15%",
    color: "#212121",
    borderColor: "#BDBDBD",
    borderWidth: 1,
    fontSize: 18,
    marginBottom: "5%",
    margin: 11,
    paddingLeft: 10,
  },
  addTransactionButton: {
    color: "red",
    width: "80%",
    height: "10%",
    backgroundColor: "#1da1f2",
    borderRadius: 10,
    justifyContent: "center",
    alignSelf: "center",
    marginTop: "10%",
  },
  addTransactionText: {
    color: "#ffffff",
    fontSize: 15,
    lineHeight: 20,
    alignSelf: "center",
  },
  portofolioButton: {
    width: "40%",
    height: 50,
    backgroundColor: "#1da1f2",
    borderRadius: 10,
    justifyContent: "center",
    alignSelf: "center",
    marginTop: "2%",
  },
  portofolioText: {
    color: "#ffffff",
    fontSize: 17,
    lineHeight: 20,
    alignSelf: "center",
  },

  routingButton: {
    alignSelf: "flex-end",
    bottom: 35,
    marginBottom: 1,
  },

  autocompleteContainer: {
    flex: 1,
    left: 0,
    position: "absolute",
    right: 0,
    top: 0,
    zIndex: 1,
  },
});
